import * as React from 'react';
import Button from '@mui/material/Button';
import HomeIcon from '@mui/icons-material/Home';
import SendIcon from '@mui/icons-material/Send';
import Stack from '@mui/material/Stack';
import '../styles/sidebar.css';
import logotxt from '../assets/logo_txt.png'

export default function sidebar() {
    return (
      <div className='bar' >
        <Stack spacing={1} direction="column">
          <img src={logotxt} alt="Musicboxd" className="logo" />
          <Button href="/" variant="contained" startIcon={<HomeIcon />} style={{ color: 'white', backgroundColor: 'black'}}>
            Accueil
          </Button>
          <Button href="/user" variant="contained" startIcon={<SendIcon />} className='button'>
            Send
          </Button>
          <Button >Page 3</Button>
        </Stack>
      </div>
    );
  }
